import './App.css';
import './assets/fonts/fonts.css';
import Navbar from './components/Navbar';
import HomePage from './components/HomePage';
import About from './components/About';
import Guidelines from './components/Guidelines';
import Domains from './components/Domains';
import Organizers from './components/Organizers';
import Student from './components/Student';
import Contact from './components/Contact';
import Footer from './components/Footer';


function App() {
  return (
    <div className="App">
        <Navbar />
        <div className="homepage"><HomePage /></div>
        <div className="about"><About /></div>
        <div className="guidelines"><Guidelines /></div>
        <div className="domains"><Domains /></div>
        <Organizers />
        <HoverBorderGradient id='contact-button' containerClassName="rounded-full" as="button" className="dark:bg-black bg-black text-white dark:text-white flex items-center space-x-2">
                abcd
            </HoverBorderGradient>
        <Student />
        <div className="contact"><Contact /></div>
        <Footer />
    </div>
  );
}

export default App;
